#[test]
fn check_create() {
    let script = "
        Paint.Enable(false)
        Paint('Initial state')
        CheckHash(0x63C1CCFA05E9F034)
    ";
    let mut a = App::debug(60, 10, script).build().unwrap();
    let mut w = window!("Title,d:c,w:40,h:8");
    let img = Image::from_str(
        r#"
        |RR.........RR|
        |B..rr...rr..B|
        |..rrrr.rrrr..|
        |.rrrrrrrrrrr.|
        |.raaaaaaaaar.|
        |..ryyyyyyyr..|
        |   rwwwwwr   |
        |....rwwwr....|
        |G....rwr....G|
        |GG....r....GG|
    "#,
    )
    .unwrap();
    w.add(ImageViewer::new(
        img,
        Layout::new("d:c"),
        image::RenderOptionsBuilder::new()
            .character_set(image::CharacterSet::SmallBlocks)
            .color_schema(ColorSchema::Color16)
            .build(),
        imageviewer::Flags::None,
    ));
    a.add_window(w);
    a.run();
}

